response.about:
Компания Swarovski является мировым лидером производства знаменитых кристаллов и изделий из них. Широкий ассортимент позволяет воплотить в жизнь любые дизайнерские фантазии. Наиболее частое применение в индуствии украшений и акксессуаров, в производстве одежды, дизайне интерьеров. Кристаллы, известные также как стразы (камни) Swarovski, используются для украшения арткостюмов, танцевальных платьев, театральных костюмов, в свадебной и вечерней моде. Разнообразие цветов, форм и размеров позволяет нанести на ткань любой рисунок или арнамент, придаст повседневной одежде особый шарм, подчеркнув Вашу индивидуальность.
Каждое товарное направление представлено рядом товарных групп (артикулов). Например, клеевые стразы с плоским дном (2006, 2012, 2028 и т.д.), наиболее популярные при изготовлении костюмов для спортивных бальных танцев, спортивной гимнастики, фигурного катания. Каждая товарная группа (артикул) производится компанией Swarovski в различных цветовых решениях.

Эксклюзивность продукции Swarovski заключается не только в большом количестве форм, цветов и размеров, но и в применении специльных эффектов, которые усиливают блеск и изменяют восприятие цвета кристаллов.
Цветовые решения
Классический цвета: Amethist, Aquamarine, Black Diamond, Blue Zircon, Capri Blue, Crystal, Crystal AB, Emerald, Fuchsia, Hyazinth, Jet, Jet AB, Jet Hematite, Jonguil, Jonguil AB, Light Amethyst, Light Colorado Topaz, Light Rose, Lihht Sapphire, Light Siam, Light Siam AB, Montana, Olivine, Peridot, Rose, Ruby, Sapphire, Siam, Smoked Topaz, Topaz, Topaz AB. 

Эксклюзивные цвета: Blue Zircon Satin, Burgundy, Citrine, Cobalt, Crysolite, Crystal Cosmojet, Crystal Dorado, Crystal Meridian Blue, Crystal Sage, Crystal Tabac, Crystal Volcano, Erinite, Fire Opal, Jet Nut, Jonguil Satin, Light Peach, Light Siam Satin, Light Topaz, Padparadscha, Sapphire Satin, Smoked Topaz Satin, Sun, Tanzanite, White Opal, White Opal Sky Blue. 

Все цвета наглядно представлены в Карте цветов.

Размеры

Каждый артикул преставленный в каталоге продукции доступен в различных размерах. Размеры указаны либо в миллиметрах, либо в виде обозначения - ss (Stone Sise) и соответствуют таблице размеров в метрическом измерении: 
ss 6 – 1,90-2,10 мм;
ss 8 – 2,30-2,50 мм;
ss 10 – 2,70-2,90 мм;
ss 12 – 3,00-3,20 мм;
ss 16 – 3,80-4,00 мм;
ss 20 – 4,60-4,80 мм;
ss 30 – 6,32-6,50 мм;
ss 34 – 7,069-7,272 мм.
